import React from "react";
let title = "This is the note title";
let content = "This is the note content";

function Note(){
    return(
        <body>
            <div className="note">
            <h1>
                {title}
            </h1>
            <p>
                {content}
            </p>
            </div>
        </body>
    );
}
export default Note;
